import React from "react";

export default function InputApp() {
	return (
		<>
			<div>
				<div>
					<div>Enter Numbers</div>
					<div>Numbers Here</div>
					<div>Random</div>
				</div>
				<div>Enter Name</div>
				<div>Expiry</div>
				<div>Background</div>
				<div>CVV</div>
			</div>
		</>
	);
}
